import React from 'react';

const SaveContactButton = () => {
  const handleDownload = () => {
    const base64Image = '';
    const vCardData = `
BEGIN:VCARD
VERSION:3.0
FN:Dr. AB. Wani
ORG:Bilmed Group of Institutions
TEL;TYPE=CELL:+919999347242
EMAIL:admin@bilmedgroup.com
URL:https://bilmedgroup.com
PHOTO;ENCODING=b;TYPE=PNG:${base64Image}
ADR;TYPE=WORK:;;BilMed Ultrasound Institute, 730, 7th Floor, JMD MEGAPOLIS, Sohna Road, Sector 48;Gurugram;Delhi NCR;122002;India
END:VCARD
    `.trim();

    const blob = new Blob([vCardData], { type: 'text/vcard' });
    const url = URL.createObjectURL(blob);

    const link = document.createElement('a');
    link.href = url;
    link.download = 'Dr_AB_Wani.vcf';
    document.body.appendChild(link);
    link.click();

    // Cleanup
    document.body.removeChild(link);
    URL.revokeObjectURL(url);
  };

  return (
    <button
      onClick={handleDownload}
      style={{
        padding: '10px 20px',
        fontSize: '16px',
        backgroundColor: '#007bff',
        color: '#fff',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer',
      }}
    >
      📇 Save Contact
    </button>
  );
};

export default SaveContactButton;
